window.bookSummaryJSON = "<p>Several years in the future, an all-female astronaut team circumnavigates the globe once every 90 minutes aboard the International Space Station, prepared to be a powerful presence in space. When a surprise set of \"everyday citizens\" tags along for the ride, all protocol flies right out the proverbial...airlock.</p> <p>After a lifetime of being kept down on the ground, what happens when these women finally rise up and see their lives - and their planet - from high above it all?</p>"; 
